import React from 'react';
import {useRouter,} from 'next/router';
import Link from 'next/link';

function HomePage() {

    const router = useRouter();

    return (
    <>
      <div>Welcome to Sponge.id Web App!</div>
        <Link route="/register">
          <a>Register</a>
        </Link>
        <Link route="/login">
          <a>Login</a>
        </Link>
    </>
    )
  };
  
export default HomePage;
